        id=\"mw-content-text\" class=\"mw-body-content\"><div class=\"mw-content-ltr
        mw-parser-output\" lang=\"en\" dir=\"ltr\"><p>\nThe <a href=\"/wiki/S%26P_500\"
        title=\"S&amp;P 500\">S&amp;P 500</a> is a <a href=\"/wiki/Stock_market_index\"
        title=\"Stock market index\">stock market index</a> maintained by <a href=\"/wiki/S%26P_Dow_Jones_Indices\"
        title=\"S&amp;P Dow Jones Indices\">S&amp;P Dow Jones Indices</a>. It comprises
        503 <a href=\"/wiki/Common_stock\" title=\"Common stock\">common stocks</a>
        which are issued by 500 <a href=\"/wiki/Market_capitalization\" title=\"Market
        capitalization\">large-cap</a> companies traded on the American stock exchanges
        (including the 30 companies that compose the <a href=\"/wiki/Dow_Jones_Industrial_Average\"
        title=\"Dow Jones Industrial Average\">Dow Jones Industrial Average</a>).
        The index includes about 80 percent of the American market by capitalization.
        It is weighted by <a href=\"/wiki/Capitalization-weighted_index#Free-float_weighting\"
        title=\"Capitalization-weighted index\">free-float</a> market capitalization,
        so more valuable companies account for relatively more weight in the index.
        The index constituents and the constituent weights are updated regularly using
        rules published by S&amp;P Dow Jones Indices. Although called the S&amp;P
        500, the index contains 503 stocks because it includes two share classes of
        stock from 3 of its component companies.<sup id=\"cite_ref-1\" class=\"reference\"><a
        href=\"#cite_note-1\"><span class=\"cite-bracket\">&#91;</span>1<span class=\"cite-bracket\">&#93;</span></a></sup><sup
        id=\"cite_ref-2\" class=\"reference\"><a href=\"#cite_note-2\"><span class=\"cite-bracket\">&#91;</span>2<span
        class=\"cite-bracket\">&#93;</span></a></sup>\n</p>\n<meta property=\"mw:PageProp/toc\"
