        class=\"mw-heading mw-heading3\"><h3 id=\"Invesco_QQQ_Trust,_Series_1_ETF_Performance\"><span
        id=\"Invesco_QQQ_Trust.2C_Series_1_ETF_Performance\"></span>Invesco QQQ Trust,
        Series 1 ETF Performance</h3><span class=\"mw-editsection\"><span class=\"mw-editsection-bracket\">[</span><a
        href=\"/w/index.php?title=Nasdaq-100&amp;action=edit&amp;section=8\" title=\"Edit
        section: Invesco QQQ Trust, Series 1 ETF Performance\"><span>edit</span></a><span
        class=\"mw-editsection-bracket\">]</span></span></div>\n<p>The Invesco QQQ
        ETF has been averaging an annual return rate of 10.09% since its inception
        back in March 1999. A $1,000 invested in QQQ January 2015 was worth a total
        of $5,431.98 10 years later at January 18, 2025, assuming the dividends were
        reinvested with <a href=\"/wiki/Dividend_reinvestment_plan\" title=\"Dividend
        reinvestment plan\">DRIP.</a> That's an annual return rate of 18.44% with
        a total return of 443.20%.<sup id=\"cite_ref-12\" class=\"reference\"><a href=\"#cite_note-12\"><span
        class=\"cite-bracket\">&#91;</span>12<span class=\"cite-bracket\">&#93;</span></a></sup>\n</p>\n<div
        class=\"mw-heading mw-heading2\"><h2 id=\"Selection_criteria\">Selection criteria</h2><span
        class=\"mw-editsection\"><span class=\"mw-editsection-bracket\">[</span><a
        href=\"/w/index.php?title=Nasdaq-100&amp;action=edit&amp;section=9\" title=\"Edit
        section: Selection criteria\"><span>edit</span></a><span class=\"mw-editsection-bracket\">]</span></span></div>\n<p>The
        Nasdaq has refined a series of stringent standards which companies must meet
        to be indexed. Those standards include:\n</p>\n<ul><li>Being listed exclusively
        on Nasdaq in either the Global Select or Global Market tiers.</li>\n<li>Being
        publicly offered on an established American market for at least three months.</li>\n<li>Having
        average daily volume of 200,000 shares.</li>\n<li>Being current in regards
        to quarterly and annual reports.</li>\n<li>Not being in <a href=\"/wiki/Bankruptcy\"
        title=\"Bankruptcy\">bankruptcy</a> proceedings.</li></ul>\n<p>Additionally,
        since 2014, companies with multiple classes of stock are allowed to have multiple
        classes included in the index, provided they meet Nasdaq's criteria. Prior
        to 2014, companies were limited to one class of stock in the index (usually
        the one with the larger market capitalization).<sup class=\"noprint Inline-Template
        Template-Fact\" style=\"white-space:nowrap;\">&#91;<i><a href=\"/wiki/Wikipedia:Citation_needed\"
        title=\"Wikipedia:Citation needed\"><span title=\"This claim needs references
        to reliable sources. (February 2018)\">citation needed</span></a></i>&#93;</sup>\n</p>\n<div
        class=\"mw-heading mw-heading3\"><h3 id=\"Yearly_rebalancing_and_re-ranking\">Yearly
        rebalancing and re-ranking</h3><span class=\"mw-editsection\"><span class=\"mw-editsection-bracket\">[</span><a
        href=\"/w/index.php?title=Nasdaq-100&amp;action=edit&amp;section=10\" title=\"Edit
        section: Yearly rebalancing and re-ranking\"><span>edit</span></a><span class=\"mw-editsection-bracket\">]</span></span></div>\n<p>While
        the composition of the Nasdaq-100 changes in the case of delisting (such as
        transferring to another exchange, <a href=\"/wiki/Mergers_and_acquisitions\"
        title=\"Mergers and acquisitions\">mergers and acquisitions</a>, or declaring
        <a href=\"/wiki/Bankruptcy\" title=\"Bankruptcy\">bankruptcy</a>, and in a
        few cases, being delisted by Nasdaq for failing to meet listing requirements),
        the index is reconstituted once a year, in December, when Nasdaq reviews its
        components, compares them with those not in the index, re-ranks all eligible
        companies and makes the appropriate adjustments.<sup class=\"noprint Inline-Template
        Template-Fact\" style=\"white-space:nowrap;\">&#91;<i><a href=\"/wiki/Wikipedia:Citation_needed\"
        title=\"Wikipedia:Citation needed\"><span title=\"This claim needs references
        to reliable sources. (February 2018)\">citation needed</span></a></i>&#93;</sup>\n</p><p>As
        of June 2024, all companies are ranked by the size of their market values
        as of the last trading day of November.<sup id=\"cite_ref-13\" class=\"reference\"><a
        href=\"#cite_note-13\"><span class=\"cite-bracket\">&#91;</span>13<span class=\"cite-bracket\">&#93;</span></a></sup>\n</p><p>Prior
        to June 2024, there were two tools the Nasdaq used to determine the market
        values of companies for the annual review:\n</p>\n<ul><li>Share Prices as
        of the last trading day in October.</li>\n<li>Publicly announced share totals
        as of the last trading day of November.</li></ul>\n<p>To determine the new
        composition of the index: The top 75 components that meet Nasdaq's standards
        are automatically included in the index as of the end of the third Friday
        in December. Those components that are in the top 100 of all eligible companies
        at the annual review are retained in the index. Those ranked 101 to 125 are
        retained, provided that they were in the top 100 of the previous year's annual
        review. If they fail to move into the top 100 in the following year's review,
        they are dropped. Those not ranked in the top 125 are dropped regardless of
        the previous year's rank.\n</p><p>The index also drops a company if, at the
        end of two consecutive months, it fails to have an index weighting of at least
        one-tenth of a percent. This can occur at any time.<sup class=\"noprint Inline-Template
        Template-Fact\" style=\"white-space:nowrap;\">&#91;<i><a href=\"/wiki/Wikipedia:Citation_needed\"
        title=\"Wikipedia:Citation needed\"><span title=\"This claim needs references
        to reliable sources. (February 2018)\">citation needed</span></a></i>&#93;</sup>
        Companies that are dropped are replaced by those with the largest market value
        that are not already in the index. Anticipation of these changes can lead
        to changes in the stock prices of affected companies.<sup class=\"noprint
        Inline-Template Template-Fact\" style=\"white-space:nowrap;\">&#91;<i><a href=\"/wiki/Wikipedia:Citation_needed\"
        title=\"Wikipedia:Citation needed\"><span title=\"This claim needs references
        to reliable sources. (February 2018)\">citation needed</span></a></i>&#93;</sup>\n</p><p>The
        index publicly announces all changes, regardless of when they occur, via <a
        href=\"/wiki/Press_releases\" class=\"mw-redirect\" title=\"Press releases\">press
        releases</a> at least five business days before the change takes place. The
        2018 results of the re-ranking and rebalancing were announced on December
        14, with the changes effective the morning of December 24, coinciding with
        the expiration of options on December 21.<sup class=\"noprint Inline-Template
        Template-Fact\" style=\"white-space:nowrap;\">&#91;<i><a href=\"/wiki/Wikipedia:Citation_needed\"
        title=\"Wikipedia:Citation needed\"><span title=\"This claim needs references
        to reliable sources. (February 2018)\">citation needed</span></a></i>&#93;</sup>\n</p>\n<div
        class=\"mw-heading mw-heading2\"><h2 id=\"Differences_from_Nasdaq_Composite_index\">Differences
        from Nasdaq Composite index</h2><span class=\"mw-editsection\"><span class=\"mw-editsection-bracket\">[</span><a
        href=\"/w/index.php?title=Nasdaq-100&amp;action=edit&amp;section=11\" title=\"Edit
        section: Differences from Nasdaq Composite index\"><span>edit</span></a><span
        class=\"mw-editsection-bracket\">]</span></span></div>\n<p>The Nasdaq-100
        is frequently confused with the <a href=\"/wiki/Nasdaq_Composite\" title=\"Nasdaq
        Composite\">Nasdaq Composite</a> Index. The latter index (often referred to
        simply as <i>\"The Nasdaq\"</i>) includes the stock of every company that
        is listed on Nasdaq (more than 3,000 altogether).<sup class=\"noprint Inline-Template
        Template-Fact\" style=\"white-space:nowrap;\">&#91;<i><a href=\"/wiki/Wikipedia:Citation_needed\"
        title=\"Wikipedia:Citation needed\"><span title=\"This claim needs references
        to reliable sources. (February 2018)\">citation needed</span></a></i>&#93;</sup>\n</p><p>The
        Nasdaq-100 is a modified <a href=\"/wiki/Capitalization-weighted_index\" title=\"Capitalization-weighted
        index\">capitalization-weighted index</a>. This particular methodology was
        created in 1998 in advance of the creation of the Nasdaq-100 Index Trust,
        which holds portions of all Nasdaq-100 firms. The new methodology allowed
        Nasdaq to reduce the influence of the largest companies and to allow for more
        diversification. However, the weights of the stocks were not changed after
        that, which led to more problems. In May 2011, Nasdaq did a major rebalance
        of the index to bring it closer to market-cap weighting.<sup class=\"noprint
        Inline-Template Template-Fact\" style=\"white-space:nowrap;\">&#91;<i><a href=\"/wiki/Wikipedia:Citation_needed\"
        title=\"Wikipedia:Citation needed\"><span title=\"This claim needs references
        to reliable sources. (February 2018)\">citation needed</span></a></i>&#93;</sup>\n</p><p>The
        index is rebalanced quarterly only if:\n</p>\n<ul><li>One company is worth
        24% of the index</li>\n<li>Companies with a weighting of at least 4.5% make
        up 48% or more of the index</li></ul>\n<p>The index is rebalanced annually,
        after the quarterly rebalancing, only if:\n</p>\n<ul><li>One company is worth
        15% of the index</li>\n<li>The five largest companies by market capitalizations
        have weights of 40% or more of the index<sup id=\"cite_ref-14\" class=\"reference\"><a
        href=\"#cite_note-14\"><span class=\"cite-bracket\">&#91;</span>14<span class=\"cite-bracket\">&#93;</span></a></sup></li></ul>\n<div
        class=\"mw-heading mw-heading2\"><h2 id=\"Differences_from_other_indices\">Differences
        from other indices</h2><span class=\"mw-editsection\"><span class=\"mw-editsection-bracket\">[</span><a
        href=\"/w/index.php?title=Nasdaq-100&amp;action=edit&amp;section=12\" title=\"Edit
        section: Differences from other indices\"><span>edit</span></a><span class=\"mw-editsection-bracket\">]</span></span></div>\n<p>In
        addition to its almost complete lack of financial companies, the Nasdaq-100
        includes seven companies incorporated outside the United States. Although
        the S&amp;P 500 Index includes non-U.S. companies, the Dow Jones Industrial
        Average has never included foreign companies.<sup class=\"noprint Inline-Template
        Template-Fact\" style=\"white-space:nowrap;\">&#91;<i><a href=\"/wiki/Wikipedia:Citation_needed\"
        title=\"Wikipedia:Citation needed\"><span title=\"This claim needs references
        to reliable sources. (February 2018)\">citation needed</span></a></i>&#93;</sup>\n</p><p>As
        of June 2024, the index's seven companies <a href=\"/wiki/Incorporation_(business)\"
        title=\"Incorporation (business)\">incorporated</a> in foreign countries are
        as follows:\n</p>\n<ul><li>Cayman Islands (headquartered in Ireland, previously
        China) - <a href=\"/wiki/Pinduoduo\" title=\"Pinduoduo\">PDD Holdings</a></li>\n<li>Ireland
        - <a href=\"/wiki/Linde_plc\" title=\"Linde plc\">Linde plc</a></li>\n<li>The
        Netherlands - <a href=\"/wiki/ASML_Holding\" title=\"ASML Holding\">ASML Holding</a>,
        <a href=\"/wiki/NXP_Semiconductors\" title=\"NXP Semiconductors\">NXP Semiconductors</a></li>\n<li>United
        Kingdom - <a href=\"/wiki/Arm_Holdings\" title=\"Arm Holdings\">Arm Holdings</a>,
        <a href=\"/wiki/AstraZeneca\" title=\"AstraZeneca\">AstraZeneca</a>, <a href=\"/wiki/Coca-Cola_Europacific_Partners\"
        title=\"Coca-Cola Europacific Partners\">Coca-Cola Europacific Partners</a></li></ul>\n<p>Additionally,
        the Nasdaq-100 is also the only index of the three that has a regularly scheduled
        re-ranking of its index each year (in December), ensuring that the largest
        non-financial companies on Nasdaq are accurately included.<sup class=\"noprint
        Inline-Template Template-Fact\" style=\"white-space:nowrap;\">&#91;<i><a href=\"/wiki/Wikipedia:Citation_needed\"
        title=\"Wikipedia:Citation needed\"><span title=\"This claim needs references
        to reliable sources. (February 2018)\">citation needed</span></a></i>&#93;</sup>\n</p>\n<div
        class=\"mw-heading mw-heading2\"><h2 id=\"Related_indices\">Related indices</h2><span
        class=\"mw-editsection\"><span class=\"mw-editsection-bracket\">[</span><a
        href=\"/w/index.php?title=Nasdaq-100&amp;action=edit&amp;section=13\" title=\"Edit
        section: Related indices\"><span>edit</span></a><span class=\"mw-editsection-bracket\">]</span></span></div>\n<p>In
        2006, Nasdaq created a \"farm team\" index, the Nasdaq Q-50, representing
        the next fifty stocks in line to enter the Nasdaq-100. With some exceptions,
        most stocks that are added to the index come up through the Q-50. In 2011,
        Nasdaq created the NASDAQ-500 to track the 500 largest stocks on Nasdaq, and
        the Nasdaq-400, tracking those stocks not included in the Nasdaq-100.<sup
        class=\"noprint Inline-Template Template-Fact\" style=\"white-space:nowrap;\">&#91;<i><a
        href=\"/wiki/Wikipedia:Citation_needed\" title=\"Wikipedia:Citation needed\"><span
        title=\"This claim needs references to reliable sources. (February 2018)\">citation
        needed</span></a></i>&#93;</sup>\n</p><p>Nasdaq has also divided the 100 into
        two distinct sub-indices; the Nasdaq-100 Tech follows those components who
        service the tech sector, and the Nasdaq-100 Ex-Tech, which follows those components
        that are not considered tech companies. The latter index includes noted <a
        href=\"/wiki/Electronic_commerce\" class=\"mw-redirect\" title=\"Electronic
        commerce\">e-commerce</a> companies <a href=\"/wiki/Amazon.com\" class=\"mw-redirect\"
        title=\"Amazon.com\">Amazon.com</a> and <a href=\"/wiki/EBay\" title=\"EBay\">eBay</a>,
        which are classified as retailers.<sup class=\"noprint Inline-Template Template-Fact\"
        style=\"white-space:nowrap;\">&#91;<i><a href=\"/wiki/Wikipedia:Citation_needed\"
        title=\"Wikipedia:Citation needed\"><span title=\"This claim needs references
        to reliable sources. (February 2018)\">citation needed</span></a></i>&#93;</sup>\n</p>\n<div
